function updateTime() {
  var t = new Date(new Date().getTime() + (1000*9.5*3600)); // convert to CST
  time.innerHTML = t.toISOString().slice(11, 19);
}


function getLocation() {
  if (navigator.geolocation) {
    navigator.geolocation.getCurrentPosition(showPosition, geoFail,
      {timeout: 10000, enableHighAccuracy: true, maximumAge: 2000});
  } else {
    distanceFromDarwin.innerHTML = "No GPS";
  }
}

function geoFail(error) {
}


function showPosition(position) {
  var x = locationOnRoute(position);
  distanceFromDarwin.innerHTML = x.toFixed(2) + " km";

  // find next control stop
  var i = 0;
  while (waypoints[i].km < x && i < waypoints.length - 1) i++;
  while (waypoints[i].name == "" && i < waypoints.length - 1) i++;
  nextWaypoint.innerHTML = waypoints[i].name;
  var d = (waypoints[i].km - x);
  distanceToNextWaypoint.innerHTML = d.toFixed(2) + " km";
  coordinate.innerHTML = "("
      + position.coords.longitude.toFixed(5) + ", "
      + position.coords.latitude.toFixed(5) + ")<br/>"
      + "accuracy: " + position.coords.accuracy.toFixed(0) + " m";
  if (position.coords.speed != null) {
    speed.innerHTML = "speed: " + (3.6*position.coords.speed).toFixed(0) + " km/h";
  }
  else {
    speed.innerHTML = ""
  }
}


/*

To project our current (long, lat) onto the route, we first find the closest waypoint.
If it is the first, we move to the second; if it is the last, we move to the penultimate.

We then project the current (long, lat) onto the segment before the waypoint; if it does not project onto this segment, we project onto the segment after the waypoint. We then interpolate the distance.

*/

function locationOnRoute(position) {
  var u, x0, x1;
  var i = closestWaypointIndex(position);
  if      (i == 0)                    i++;
  else if (i == waypoints.length - 1) i--;
  u = proportionAlongSegment(i-1, position);
  if (u < 1) {
    x0 = waypoints[i-1].km;
    x1 = waypoints[i].km;
  }
  else {
    u = proportionAlongSegment(i, position);
    x0 = waypoints[i].km;
    x1 = waypoints[i+1].km;
  }

  if      (u < 0) return x0
  else if (u > 1) return x1
  else            return x0 + u*(x1 - x0);
}


function proportionAlongSegment(i, position) {
  var x = position.coords.longitude;
  var y = position.coords.latitude;
  var x0 = waypoints[i].longitude;
  var y0 = waypoints[i].latitude;
  var x1 = waypoints[i+1].longitude;
  var y1 = waypoints[i+1].latitude;
  var d  = sq(x1 - x0) + sq(y1 - y0);
  var u  = ((x - x0)*(x1 - x0) + (y - y0)*(y1 - y0))/d;
  return u;
}


// For a given position, we want to find the closest waypoint index. A linear search is fast enough.

function closestWaypointIndex(position) {
  var i = 0;
  var imin = 0;
  var dmin = d2(waypoints[imin].longitude, waypoints[imin].latitude,
                position.coords.longitude, position.coords.latitude);
  for (i = 1; i < waypoints.length; i++) {
    var d = d2(waypoints[i].longitude, waypoints[i].latitude,
               position.coords.longitude, position.coords.latitude);
    if (d < dmin) {
      dmin = d;
      imin = i;
    }
  }
  return imin;
}


function d2(long0, lat0, long1, lat1) {
  return sq(long1 - long0) + sq(lat1 - lat0);
}

function sq(x) {
  return x*x;
}


function main() {
  setInterval("loop()", 1000);
}


function loop() {
  updateTime();
  getLocation();
}
